import "../styleComponents/navbar.css";
import React, { useState } from "react";
import {
  Navbar, NavbarBrand, NavbarToggler, Nav, NavLink, NavItem, Collapse, DropdownItem, DropdownMenu, DropdownToggle, UncontrolledDropdown, Input
} from "reactstrap";


const Navbarr = () => {
  const [isOpen, setIsOpen] = useState(false);
  return (
    <div>
      <Navbar id="nav" dark expand="md" fixed="top" full>
        <NavbarBrand href="/">Study Buddy</NavbarBrand>
        <NavbarToggler
          onClick={() => {
            setIsOpen(!isOpen);
          }}
        />
        <Collapse isOpen={isOpen} navbar>
          <Nav className="me-auto" navbar>
            <NavItem>
              <NavLink href="/components/">Home</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="#">Features</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="#">About</NavLink>
            </NavItem>
            <NavItem>
              <Input
                type="search"
              />
              <Input
                type="button"
                className="btn btn-light"
              />
            </NavItem>
            <UncontrolledDropdown inNavbar nav>
              <DropdownToggle caret nav>
                More
              </DropdownToggle>
              <DropdownMenu right>
                <DropdownItem>SEM 1</DropdownItem>
                <DropdownItem>SEM 2</DropdownItem>
                {/* <DropdownItem divider /> */}
                <DropdownItem>SEM 3</DropdownItem>
              </DropdownMenu>
            </UncontrolledDropdown>
          </Nav>
          {/* <NavbarText>Simple Text</NavbarText> */}
        </Collapse>
      </Navbar>
    </div>
  );
}

export default Navbarr;
